const OUTPUT_ACCELERATION = 0.003 * ATOM_SIZE
const OUTPUT_START_SPEED = 0 * ATOM_SIZE
const OUTPUT_MAX_DISTANCE = 500 * ATOM_SIZE

const outputNumbers = []
on.process(() => {

	let goneTooFarId = undefined

	for (let i = 0; i < outputNumbers.length; i++) {
		const mesh = outputNumbers[i]
		if (mesh.outputSpeed == undefined) {
			mesh.outputSpeed = OUTPUT_START_SPEED
		}
		mesh.position.x += mesh.outputSpeed
		mesh.outputSpeed += OUTPUT_ACCELERATION
		if (mesh.position.x > OUTPUT_MAX_DISTANCE) {
			goneTooFarId = i
		}
		if (goneTooFarId != undefined) {
			mesh.material.dispose()
			mesh.geometry.dispose()
			scene.remove(mesh)
		}
	}
	
	if (goneTooFarId != undefined) outputNumbers.length = goneTooFarId
})

